.Replace("\r", "").Split("\n");
int lineLength = input[0].Length;
int numberOflines = input.Length;
char middleChar = 'A';
char[] cornerCharacters = ['M', 'S'];
int output = 0;
char[,] matrix = new char[numberOflines, lineLength];
for (int i = 0; i < input.Length; i++)
{
    string line = input[i];
    for (int j = 0; j < line.Length; j++)
    {
        matrix[i, j] = line[j];
    }
}

for (int i = 1; i < numberOflines-1; i++)
{
    for (int j = 1; j < lineLength-1; j++)
    {
        if (checkForX(i, j))
        {
            output++;
        }
    }
}
Console.WriteLine(output);

bool checkForX(int x,int y)
{
    if (!(matrix[x,y]==middleChar))
    {
        return false;
    }
    if (cornerCharacters.Contains(matrix[x - 1, y - 1]) )
    {
        char cornerChar = matrix[x - 1, y - 1];
        char otherChar = cornerCharacters.First(c => c != cornerChar);
        if (matrix[x+1,y-1]== cornerChar)
        {
            if (matrix[x-1,y+1]==otherChar&& matrix[x + 1, y + 1] == otherChar)
            {
                return true;
            }
        }
        if (matrix[x-1,y+1]==cornerChar)
        {
            if (matrix[x + 1, y - 1] == otherChar && matrix[x + 1, y + 1] == otherChar)
            {
                return true;
            }
        }
    }
    return false;
}
